INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118061, 2, 0, "ペコリーヌとの出会い", "フリーマーケット会場", 2834, 7, 10118, 40, 20063115, 91002, 1, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118062, 2, 0, "マホとの出会い", "フリーマーケット会場", 2835, 7, 10118, 40, 20063115, 91002, 1, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118063, 2, 0, "アキノとの出会い", "ランドソル市街地", 2837, 7, 10118, 40, 20063115, 91002, 1, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118064, 2, 0, "ジュンとの出会い", "フリーマーケット会場", 4108402, 18, 10118, 40, 20063115, 91002, 1, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118065, 2, 0, "カオリとの出会い", "フリーマーケット会場", 4107402, 18, 10118, 40, 20063115, 91002, 1, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118066, 2, 1, "ニノンとの出会い", "オーエド町", 9000227, 16, 10118, 40, 20063115, 91002, 1, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118067, 3, 0, "スズナとの出会い", "フリーマーケット会場", 2101181, 19, 10118, 40, 20063115, 91002, 1, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118068, 3, 0, "ナナカとの出会い", "ランドソル市街地", 4109402, 18, 10118, 40, 20063115, 91002, 1, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118069, 3, 0, "キャル＆コッコロとの出会い", "フリーマーケット会場", 4305402, 18, 10118, 40, 20063115, 91002, 1, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118070, 3, 0, "ユカリとの出会い", "ランドソル市街地", 4101402, 18, 10118, 40, 20063115, 91002, 1, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118071, 3, 0, "アオイとの出会い", "ランドソル市街地", 4106402, 18, 10118, 40, 20063115, 91002, 1, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118072, 3, 1, "シノブとの出会い", "フリーマーケット会場", 2836, 7, 10118, 40, 20063115, 91002, 1, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 8);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (5118600, 1, 0, "オープニング", 0, 0, 0, 10118, 0, 20063115, 0, 0, "彼女たちの新たな日常", 0, 0);
